        return ( 
            <React.Fragment>
                <NavBar/>
             <div className="catalog-page">
                 
             <div className="course-header">             
             <h1 className="courses-heading"> Coding with Purpose</h1>
             </div>
             <div>
                 <button> javascript</button>
                 <button> jquery</button>
